import React, { useEffect, useState } from 'react';
import { Thermometer, Droplets, Activity, Cloud, Server, AlertCircle } from 'lucide-react';
import axios from 'axios';

const WelcomePage = () => {
  const [data, setData] = useState({
    totalDevices: 0,
    activeSensors: 0,
    avgTemperature: null,
    avgHumidity: null,
    activeAlerts: 0,
  });

  useEffect(() => {
    const fetchData = async () => {
      try {
        const devicesRes = await axios.get("https://sensorium-api.vercel.app/api/devices");
        const devices = devicesRes.data;
        const totalDevices = devices.length;

        let activeSensors = 0;

        const sensorPromises = devices.map(device =>
          axios.get(`https://sensorium-api.vercel.app/api/sensors/${device.deviceId}`)
        );
        
        const sensorResponses = await Promise.all(sensorPromises);
        sensorResponses.forEach(res => {
          activeSensors += res.data.length;
        });

        // Mocking the alerts and averages for this demonstration to match the image
        const mockAvgTemperature = 22.5;
        const mockAvgHumidity = 65;
        const mockActiveAlerts = 2;

        setData({
          totalDevices,
          activeSensors,
          avgTemperature: mockAvgTemperature,
          avgHumidity: mockAvgHumidity,
          activeAlerts: mockActiveAlerts,
        });

      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, []);

  return (
    <div className="p-8">
      <h1 className="text-3xl font-bold text-gray-800">Welcome to Sensorium</h1>
      <p className="text-gray-600 mt-1">Your centralized hub for real-time sensor monitoring.</p>

      <div className="mt-8">
        <h2 className="text-2xl font-semibold text-gray-700">System Overview</h2>
        <div className="space-y-4 mt-4">
          <div className="flex items-center space-x-2">
            <Server className="w-5 h-5 text-gray-500" />
            <span className="font-medium">Total Devices</span>
            <span className="font-bold text-lg">{data.totalDevices}</span>
          </div>
          <div className="flex items-center space-x-2">
            <Activity className="w-5 h-5 text-gray-500" />
            <span className="font-medium">Active Sensors</span>
            <span className="font-bold text-lg">{data.activeSensors}</span>
          </div>
          <div className="flex items-center space-x-2">
            <Thermometer className="w-5 h-5 text-gray-500" />
            <span className="font-medium">Avg. Temperature</span>
            <span className="font-bold text-lg">{data.avgTemperature !== null ? `${data.avgTemperature}°C` : 'N/A'}</span>
          </div>
          <div className="flex items-center space-x-2">
            <Droplets className="w-5 h-5 text-gray-500" />
            <span className="font-medium">Avg. Humidity</span>
            <span className="font-bold text-lg">{data.avgHumidity !== null ? `${data.avgHumidity}%` : 'N/A'}</span>
          </div>
          <div className="flex items-center space-x-2">
            <AlertCircle className="w-5 h-5 text-gray-500" />
            <span className="font-medium">Active Alerts</span>
            <span className="font-bold text-lg">{data.activeAlerts}</span>
          </div>
        </div>
      </div>
      <div className="mt-8">
        <h3 className="text-xl font-semibold text-gray-700">Detailed Reports and Analytics</h3>
      </div>
    </div>
  );
};

export default WelcomePage;
